import React from "react";
import { Timeline } from "antd";

const Experience = () => (
  <div className="experience-wrapper">
    <div className="working-experience-wrapper">
      <h2>Experience</h2>
      <Timeline>
        <Timeline.Item><p>SDE Intern @ Tencent, PUBG Mobile</p></Timeline.Item>
        <Timeline.Item><p>Undergrad Research Assistant @ USC Data Science Lab</p></Timeline.Item>
        <Timeline.Item><p>Data Enginner @ Grandhonor Inc.</p></Timeline.Item>
      </Timeline>
    </div>
    <div className="education-experience-wrapper"></div>
  </div>
);

export default Experience;
